INSERT INTO `pybb_post` VALUES (4,'commence trash talk here.','commence trash talk here.','commence trash talk here.',3,1,'2012-01-26 22:26:32',NULL,'127.0.0.1',0),(6,'When I select PLAYERS in the header, I am taken to http://www.tecmofantasybowl.com/team/CHI/\r\n','When I select PLAYERS in the header, I am taken to <a href=\"http://www.tecmofantasybowl.com/team/CHI/\">http://www.tecmofantasybowl.com/team/CHI/</a><br/>','When I select PLAYERS in the header, I am taken to http://www.tecmofantasybowl.com/team/CHI/',4,29,'2012-02-19 12:40:50',NULL,'127.0.0.1',0),(7,'Is there a way to view available players? My team is pretty awful and I would like to see what\'s out there before I drop er\'body.','Is there a way to view available players? My team is pretty awful and I would like to see what\'s out there before I drop er\'body.','Is there a way to view available players? My team is pretty awful and I would like to see what\'s out there before I drop er\'body.',5,29,'2012-02-19 12:41:31',NULL,'127.0.0.1',0),(8,'Will there be  \"last season\" stats page available after we sim a season or two? Or just current season?\r\n\r\nI like to compare year to year/season to season.','Will there be  &ldquo;last season&rdquo; stats page available after we sim a season or two? Or just current season?<br/><br/>I like to compare year to year/season to season.','Will there be  &ldquo;last season&rdquo; stats page available after we sim a season or two? Or just current season?I like to compare year to year/season to season.',6,18,'2012-02-19 12:59:57',NULL,'127.0.0.1',0),(21,'I like what you are saying Joel.  Somewhere down the road it would be nice to be in a couple \"seasons\".  So your site could offer a league to play a specific nfl season, like 1991 or 2005.  \r\n\r\nI would pay my money, create my league and select a season.  I know it\'s a lot of work to create custom rosters that have accurate attributes for all the players but like I said.... down the road.  \r\n\r\n','I like what you are saying Joel.  Somewhere down the road it would be nice to be in a couple &ldquo;seasons&rdquo;.  So your site could offer a league to play a specific nfl season, like 1991 or 2005.  <br/><br/>I would pay my money, create my league and select a season.  I know it\'s a lot of work to create custom rosters that have accurate attributes for all the players but like I said&#8230;. down the road.  <br/><br/>','I like what you are saying Joel.  Somewhere down the road it would be nice to be in a couple &ldquo;seasons&rdquo;.  So your site could offer a league to play a specific nfl season, like 1991 or 2005.  I would pay my money, create my league and select a season.  I know it\'s a lot of work to create custom rosters that have accurate attributes for all the players but like I said&#8230;. down the road.  ',6,21,'2012-02-19 20:15:39',NULL,'127.0.0.1',0),(11,'My matchup screen doesn\'t show who I\'m matched up against. It\'s just empty grids.\r\n','My matchup screen doesn\'t show who I\'m matched up against. It\'s just empty grids.<br/>','My matchup screen doesn\'t show who I\'m matched up against. It\'s just empty grids.',7,18,'2012-02-19 13:06:22',NULL,'127.0.0.1',0),(12,'You should be able to set your profile picture to a girl face.','You should be able to set your profile picture to a girl face.','You should be able to set your profile picture to a girl face.',8,18,'2012-02-19 13:08:28',NULL,'127.0.0.1',0),(13,'I can\'t figure out how to add/drop. ','I can\'t figure out how to add/drop. ','I can\'t figure out how to add/drop. ',9,18,'2012-02-19 13:10:57',NULL,'127.0.0.1',0),(20,'It might also be nice to see the matchup page show all the matchup\'s for the week.  That way I can see at a glance who scored what.','It might also be nice to see the matchup page show all the matchup\'s for the week.  That way I can see at a glance who scored what.','It might also be nice to see the matchup page show all the matchup\'s for the week.  That way I can see at a glance who scored what.',7,21,'2012-02-19 20:10:40',NULL,'127.0.0.1',0),(14,'yeah cause the bears are #1 in the world.','yeah cause the bears are #1 in the world.','yeah cause the bears are #1 in the world.',4,1,'2012-02-19 14:08:19',NULL,'127.0.0.1',0),(15,'I would like to have a \"last season\" stats page, that will be helpful if I reuse roms but when I start doing roms that have their own attribs it could be a little misleading.  Also rosters will change a lot between seasons if I don\'t play linearly... example: Season #4 on live could be 1999 NFL, then folks would have to go to nfl.com and do their research.','I would like to have a &ldquo;last season&rdquo; stats page, that will be helpful if I reuse roms but when I start doing roms that have their own attribs it could be a little misleading.  Also rosters will change a lot between seasons if I don\'t play linearly&#8230; example: Season #4 on live could be 1999 NFL, then folks would have to go to <a href=\"http://nfl.com\">nfl.com</a> and do their research.','I would like to have a &ldquo;last season&rdquo; stats page, that will be helpful if I reuse roms but when I start doing roms that have their own attribs it could be a little misleading.  Also rosters will change a lot between seasons if I don\'t play linearly&#8230; example: Season #4 on live could be 1999 NFL, then folks would have to go to nfl.com and do their research.',6,1,'2012-02-19 14:10:48',NULL,'127.0.0.1',0),(35,'If you see a header of \"SITE IS UNDERGOING MAINTENANCE\" underneath the TECMO FANTASY BOWL header, that means that nothing you do will be saved.  So proceed with caution if you ever see that banner.\r\n\r\nSince my host seems to have an issue with me actually running any tools to administer the structure of my app (or I just don\'t know how) I pull down my database locally, apply the patches, and re-upload the database to insert.  \r\n\r\nThe banner is just another way of saying \"Hey idiot, i\'m working on the site\'s database so everything you do is going bye bye\"','If you see a header of &ldquo;SITE IS UNDERGOING MAINTENANCE&rdquo; underneath the TECMO FANTASY BOWL header, that means that nothing you do will be saved.  So proceed with caution if you ever see that banner.<br/><br/>Since my host seems to have an issue with me actually running any tools to administer the structure of my app (or I just don\'t know how) I pull down my database locally, apply the patches, and re-upload the database to insert.  <br/><br/>The banner is just another way of saying &ldquo;Hey idiot, i\'m working on the site\'s database so everything you do is going bye bye&rdquo;','If you see a header of &ldquo;SITE IS UNDERGOING MAINTENANCE&rdquo; underneath the TECMO FANTASY BOWL header, that means that nothing you do will be saved.  So proceed with caution if you ever see that banner.Since my host seems to have an issue with me actually running any tools to administer the structure of my app (or I just don\'t know how) I pull down my database locally, apply the patches, and re-upload the database to insert.  The banner is just another way of saying &ldquo;Hey idiot, i\'m working on the site\'s database so everything you do is going bye bye&rdquo;',12,1,'2012-02-20 20:01:00',NULL,'127.0.0.1',0),(16,'That is because we are preseason status, I can see how it\'s a little misleading - i\'ll change it to say something like \"You are not matched up against anyone yet\" or \"Matchup Data Doesn\'t Exist\"... any suggestions?  You\'re the eloquent one in the household.','That is because we are preseason status, I can see how it\'s a little misleading - i\'ll change it to say something like &ldquo;You are not matched up against anyone yet&rdquo; or &ldquo;Matchup Data Doesn\'t Exist&rdquo;&#8230; any suggestions?  You\'re the eloquent one in the household.','That is because we are preseason status, I can see how it\'s a little misleading - i\'ll change it to say something like &ldquo;You are not matched up against anyone yet&rdquo; or &ldquo;Matchup Data Doesn\'t Exist&rdquo;&#8230; any suggestions?  You\'re the eloquent one in the household.',7,1,'2012-02-19 14:12:15',NULL,'127.0.0.1',0),(17,'i agree!  maybe two or 3 custom faces for women?  1 white 1 black?  Thoughts?','i agree!  maybe two or 3 custom faces for women?  1 white 1 black?  Thoughts?','i agree!  maybe two or 3 custom faces for women?  1 white 1 black?  Thoughts?',8,1,'2012-02-19 14:13:01',NULL,'127.0.0.1',0),(18,'Right now the only place to add drop is in the profile page.  I have plans to put it in the \"My Team\" page as well.','Right now the only place to add drop is in the profile page.  I have plans to put it in the &ldquo;My Team&rdquo; page as well.','Right now the only place to add drop is in the profile page.  I have plans to put it in the &ldquo;My Team&rdquo; page as well.',9,1,'2012-02-19 14:13:40',NULL,'127.0.0.1',0),(19,'hrm good point, right now you\'re not directed to FA until you have an available spot.  This is a good idea!','hrm good point, right now you\'re not directed to FA until you have an available spot.  This is a good idea!','hrm good point, right now you\'re not directed to FA until you have an available spot.  This is a good idea!',5,1,'2012-02-19 14:19:56',NULL,'127.0.0.1',0),(22,'haha.  nice, Joel.','haha.  nice, Joel.','haha.  nice, Joel.',4,21,'2012-02-19 20:16:53',NULL,'127.0.0.1',0),(23,'What is the players tab supposed to be?','What is the players tab supposed to be?','What is the players tab supposed to be?',4,29,'2012-02-19 20:30:15',NULL,'127.0.0.1',0),(24,'I H@X0R3D this and found a temp work around.\r\n\r\nhttp://www.tecmofantasybowl.com/pickup/te/\r\n\r\nPick your flavor to see the list.','I H@X0R3D this and found a temp work around.<br/><br/><a href=\"http://www.tecmofantasybowl.com/pickup/te/\">http://www.tecmofantasybowl.com/pickup/te/</a><br/><br/>Pick your flavor to see the list.','I H@X0R3D this and found a temp work around.http://www.tecmofantasybowl.com/pickup/te/Pick your flavor to see the list.',5,29,'2012-02-19 20:32:59',NULL,'127.0.0.1',0),(25,'A back button or Breadcrumbs?\r\n\r\nForum > TF > AWESOMEPARTYHERE\r\n\r\nI have to click Forum and then Tecmo Fantasy Bowl each time to view a thread. NOMSAYIN?','A back button or Breadcrumbs?<br/><br/>Forum &gt; TF &gt; AWESOMEPARTYHERE<br/><br/>I have to click Forum and then Tecmo Fantasy Bowl each time to view a thread. NOMSAYIN?','A back button or Breadcrumbs?Forum > TF > AWESOMEPARTYHEREI have to click Forum and then Tecmo Fantasy Bowl each time to view a thread. NOMSAYIN?',10,29,'2012-02-19 20:34:25',NULL,'127.0.0.1',0),(26,'i totally agree, this forum is 3rd party site plugin.  I\'ll have to look in to editing their source.  Doable, but hardly on my radar.  Do you think I should switch to a phpbb hosted offsite or something?','i totally agree, this forum is 3rd party site plugin.  I\'ll have to look in to editing their source.  Doable, but hardly on my radar.  Do you think I should switch to a phpbb hosted offsite or something?','i totally agree, this forum is 3rd party site plugin.  I\'ll have to look in to editing their source.  Doable, but hardly on my radar.  Do you think I should switch to a phpbb hosted offsite or something?',10,1,'2012-02-19 21:14:14',NULL,'127.0.0.1',0),(27,'dave, i spent a few hours today coding something to address this.','dave, i spent a few hours today coding something to address this.','dave, i spent a few hours today coding something to address this.',5,1,'2012-02-19 21:14:58',NULL,'127.0.0.1',0),(28,'that players tab is supposed to be a \"How are the players in the game doing so far...\"\r\n\r\nI\'d like to expand it to include league leaders sortable by positions, and detailed per game stats for players.  Right now it just groups players per their pro team.','that players tab is supposed to be a &ldquo;How are the players in the game doing so far&#8230;&rdquo;<br/><br/>I\'d like to expand it to include league leaders sortable by positions, and detailed per game stats for players.  Right now it just groups players per their pro team.','that players tab is supposed to be a &ldquo;How are the players in the game doing so far&#8230;&rdquo;I\'d like to expand it to include league leaders sortable by positions, and detailed per game stats for players.  Right now it just groups players per their pro team.',4,1,'2012-02-19 21:16:40',NULL,'127.0.0.1',0),(29,'mike I have a number of roms that reflect player attributes through those seasons.  OF course no rom will be used without it going through an offline test season so I can validate it\'s legitimacy.\r\n\r\nHonestly i\'m most excited about dynasty seasons.  85 Bears... 94 49ers... yeah.','mike I have a number of roms that reflect player attributes through those seasons.  OF course no rom will be used without it going through an offline test season so I can validate it\'s legitimacy.<br/><br/>Honestly i\'m most excited about dynasty seasons.  85 Bears&#8230; 94 49ers&#8230; yeah.','mike I have a number of roms that reflect player attributes through those seasons.  OF course no rom will be used without it going through an offline test season so I can validate it\'s legitimacy.Honestly i\'m most excited about dynasty seasons.  85 Bears&#8230; 94 49ers&#8230; yeah.',6,1,'2012-02-19 21:18:18',NULL,'127.0.0.1',0),(30,'Mike,\r\n\r\nThat is actually visible once the matchup data has been created after the \"draft\" should be.  The logic would follow this:\r\n\r\nTeams sign up with League -> Draft -> Wait for season to start -> Matchups are created -> all matchup stuff is visible -> chaos ensues.\r\n\r\nIt will all be visible from the \"League\"  page.  That is like the main landing page for the fantasy football aspect of the site.','Mike,<br/><br/>That is actually visible once the matchup data has been created after the &ldquo;draft&rdquo; should be.  The logic would follow this:<br/><br/>Teams sign up with League -&gt; Draft -&gt; Wait for season to start -&gt; Matchups are created -&gt; all matchup stuff is visible -&gt; chaos ensues.<br/><br/>It will all be visible from the &ldquo;League&rdquo;  page.  That is like the main landing page for the fantasy football aspect of the site.','Mike,That is actually visible once the matchup data has been created after the &ldquo;draft&rdquo; should be.  The logic would follow this:Teams sign up with League -> Draft -> Wait for season to start -> Matchups are created -> all matchup stuff is visible -> chaos ensues.It will all be visible from the &ldquo;League&rdquo;  page.  That is like the main landing page for the fantasy football aspect of the site.',7,1,'2012-02-19 21:20:56',NULL,'127.0.0.1',0),(31,'In quick profile you should now be able to click on the link to the position and it will bring a modal popup to show who is available.  \r\n\r\nIF you have an available spot on your roster you can add the player from there.  However the redirect is kind of hairy right now.  Can massage how that goes more in the future.','In quick profile you should now be able to click on the link to the position and it will bring a modal popup to show who is available.  <br/><br/>IF you have an available spot on your roster you can add the player from there.  However the redirect is kind of hairy right now.  Can massage how that goes more in the future.','In quick profile you should now be able to click on the link to the position and it will bring a modal popup to show who is available.  IF you have an available spot on your roster you can add the player from there.  However the redirect is kind of hairy right now.  Can massage how that goes more in the future.',5,1,'2012-02-19 21:27:48',NULL,'127.0.0.1',0),(32,'You guys are great!  The input has already helped me catch things I never thought about.  Some things you may notice are:\r\n\r\nClicking on the position in \"quick roster\" will now bring up a list of available players in that position.  If you have an open slot in that position you can even pick up a player from that popup.  Redirect is kind of buggy, but I have an idea for that.\r\n\r\nIf there is no matchup data created for the system yet and you click on your matchup link at the top it will tell you there is no matchup data.  This should alleviate some confusion.','You guys are great!  The input has already helped me catch things I never thought about.  Some things you may notice are:<br/><br/>Clicking on the position in &ldquo;quick roster&rdquo; will now bring up a list of available players in that position.  If you have an open slot in that position you can even pick up a player from that popup.  Redirect is kind of buggy, but I have an idea for that.<br/><br/>If there is no matchup data created for the system yet and you click on your matchup link at the top it will tell you there is no matchup data.  This should alleviate some confusion.','You guys are great!  The input has already helped me catch things I never thought about.  Some things you may notice are:Clicking on the position in &ldquo;quick roster&rdquo; will now bring up a list of available players in that position.  If you have an open slot in that position you can even pick up a player from that popup.  Redirect is kind of buggy, but I have an idea for that.If there is no matchup data created for the system yet and you click on your matchup link at the top it will tell you there is no matchup data.  This should alleviate some confusion.',11,1,'2012-02-19 21:30:43',NULL,'127.0.0.1',0),(33,'fixed buggy redirect.  Was going to lose sleep over that one.','fixed buggy redirect.  Was going to lose sleep over that one.','fixed buggy redirect.  Was going to lose sleep over that one.',11,1,'2012-02-19 21:33:13',NULL,'127.0.0.1',0),(34,'I reread your comment and realized that you were talking about people joining this site and choosing which flavor of tecmo roster to play with.  I don\'t see that happening soon if ever.  The whole idea of this site so far is so that everyone can follow along with the central \"master games\" which I simulate.\r\n\r\nThere has been mumbling in my sleep about opening this up as a tecmo fantasy framework where people can upload their rom and it would generate the roster folks play with... after that folks just upload their weekly stat files and it updates everyone in their league based on the stat files the commish uploads.\r\n\r\nRight now that is a pipe dream and is not likely to happen.  It\'s a possibility if I get burned out on simming games and playing dungeon master for this site though.','I reread your comment and realized that you were talking about people joining this site and choosing which flavor of tecmo roster to play with.  I don\'t see that happening soon if ever.  The whole idea of this site so far is so that everyone can follow along with the central &ldquo;master games&rdquo; which I simulate.<br/><br/>There has been mumbling in my sleep about opening this up as a tecmo fantasy framework where people can upload their rom and it would generate the roster folks play with&#8230; after that folks just upload their weekly stat files and it updates everyone in their league based on the stat files the commish uploads.<br/><br/>Right now that is a pipe dream and is not likely to happen.  It\'s a possibility if I get burned out on simming games and playing dungeon master for this site though.','I reread your comment and realized that you were talking about people joining this site and choosing which flavor of tecmo roster to play with.  I don\'t see that happening soon if ever.  The whole idea of this site so far is so that everyone can follow along with the central &ldquo;master games&rdquo; which I simulate.There has been mumbling in my sleep about opening this up as a tecmo fantasy framework where people can upload their rom and it would generate the roster folks play with&#8230; after that folks just upload their weekly stat files and it updates everyone in their league based on the stat files the commish uploads.Right now that is a pipe dream and is not likely to happen.  It\'s a possibility if I get burned out on simming games and playing dungeon master for this site though.',6,1,'2012-02-19 22:52:13',NULL,'127.0.0.1',0),(36,'and since it wont be saved, that includes forum posts.','and since it wont be saved, that includes forum posts.','and since it wont be saved, that includes forum posts.',12,1,'2012-02-20 20:52:53',NULL,'127.0.0.1',0),(37,'I\'d recommend getting rid of the Tecmo Font for the message board.  Reading anything is fairly awful','I\'d recommend getting rid of the Tecmo Font for the message board.  Reading anything is fairly awful','I\'d recommend getting rid of the Tecmo Font for the message board.  Reading anything is fairly awful',13,20,'2012-02-21 13:49:25',NULL,'127.0.0.1',0),(38,'I agree on removing the font in the forum.  Numbers aren\'t using the same font in game - not sure about the forum.  We\'ll find out now 0123456789','I agree on removing the font in the forum.  Numbers aren\'t using the same font in game - not sure about the forum.  We\'ll find out now 0123456789','I agree on removing the font in the forum.  Numbers aren\'t using the same font in game - not sure about the forum.  We\'ll find out now 0123456789',13,30,'2012-02-21 20:03:31',NULL,'127.0.0.1',0),(39,'Here are a few comments so far:\r\n*Set face in the profile page clears out any changes done to team name, slogan etc.  Maybe combine in to a single submit button?\r\n\r\n*Numbers aren\'t included in this font (ex. 0123)\r\n\r\n*When I try to make a change to my roster in the middle of a sim, it isn\'t clear why I\'m not able to.  Currently, nothing happened and the page just refreshed.  Maybe a screen stating the roster is currently locked or a pop up saying why I can\'t drop.\r\n\r\n*What does it mean when a player is highlighted red on the match up screen?\r\n\r\n*\"Players\" page only shows players from Chicago and Dallas.  Is that the expected behavior currently?\r\n\r\n*I dropped all the player off my team and got an error page.  It looks like a lot of debug information.  I\'ll e-mail it to you and maybe read through it to see if there is anything interesting.\r\n\r\nWhen I try to drop the last filled spot on my page, it throws the error above.  I can go back and add a player, but if I don\'t and try to go on to a new page it will stay broken.  Currently, I have an empty team and any time I try to go to matchup or profile I get the error.  My Team page does work, but shows my team as empty.','Here are a few comments so far:<br/>*Set face in the profile page clears out any changes done to team name, slogan etc.  Maybe combine in to a single submit button?<br/><br/>*Numbers aren\'t included in this font (ex. 0123)<br/><br/>*When I try to make a change to my roster in the middle of a sim, it isn\'t clear why I\'m not able to.  Currently, nothing happened and the page just refreshed.  Maybe a screen stating the roster is currently locked or a pop up saying why I can\'t drop.<br/><br/>*What does it mean when a player is highlighted red on the match up screen?<br/><br/>*&ldquo;Players&rdquo; page only shows players from Chicago and Dallas.  Is that the expected behavior currently?<br/><br/>*I dropped all the player off my team and got an error page.  It looks like a lot of debug information.  I\'ll e-mail it to you and maybe read through it to see if there is anything interesting.<br/><br/>When I try to drop the last filled spot on my page, it throws the error above.  I can go back and add a player, but if I don\'t and try to go on to a new page it will stay broken.  Currently, I have an empty team and any time I try to go to matchup or profile I get the error.  My Team page does work, but shows my team as empty.','Here are a few comments so far:*Set face in the profile page clears out any changes done to team name, slogan etc.  Maybe combine in to a single submit button?*Numbers aren\'t included in this font (ex. 0123)*When I try to make a change to my rost