0),(64,'tentatively fixed, would like to add more female profile pictures.  2 are in now.','tentatively fixed, would like to add more female profile pictures.  2 are in now.','tentatively fixed, would like to add more female profile pictures.  2 are in now.',8,1,'2012-02-24 23:22:07',NULL,'127.0.0.1',0),(65,'marking this as fixed since all feature req / bugs / clarification issues have been addressed. ','marking this as fixed since all feature req / bugs / clarification issues have been addressed. ','marking this as fixed since all feature req / bugs / clarification issues have been addressed. ',14,1,'2012-02-25 12:11:21',NULL,'127.0.0.1',0),(66,'You will notice some minor and major (i\'d like to call them) improvements to your navigating experience as you traverse the site.\r\n\r\nMostly this is all about increasing the amount of data you see in fewer places.  That means that you shouldn\'t have to click across 3 different pages on the site to get related data.  Changes include:\r\n\r\nMatchup\r\n- When you click on your own player to view their stats you have the option to drop them.\r\n- There is now a (B) added to the player\'s name if they are on a bye week.\r\n- When you look at a matchup it will show all of the matchups for that week at the bottom of the page so you can keep tabs on all of the scores.  The week of the matchups shown are dependent on which matchup you\'re looking at.  (Week 3 matchup will show all week 3 matchups)\r\n\r\nMy Team\r\n- Players with a Grey background are on a bye week.\r\n- You can now drop and add players to your team from the \"My Team\" tab.\r\n- You can also drop a player while looking at their stats (just like in the matchup page).\r\n\r\nOther People\'s Team\r\n- No new features, just want to let you know that none of the features in the above \"My Team\" page are in the \"Other Team\" page... you can\'t see their byes unless you look at their matchup.  Strategery indeed.\r\n\r\nProfile\r\n- Removed \"Quick Roster\"\r\n- Planning on adding \"Trophies and Achievements\" section.  I have plans for xbox live style unlockables and trophies for top 3 finishers in seasons.  This will go where the quickroster was.\r\n\r\nI hope you like the UI improvements.\r\n\r\nOn the radar next is the Player tab. ','You will notice some minor and major (i\'d like to call them) improvements to your navigating experience as you traverse the site.<br/><br/>Mostly this is all about increasing the amount of data you see in fewer places.  That means that you shouldn\'t have to click across 3 different pages on the site to get related data.  Changes include:<br/><br/>Matchup<br/>- When you click on your own player to view their stats you have the option to drop them.<br/>- There is now a (B) added to the player\'s name if they are on a bye week.<br/>- When you look at a matchup it will show all of the matchups for that week at the bottom of the page so you can keep tabs on all of the scores.  The week of the matchups shown are dependent on which matchup you\'re looking at.  (Week 3 matchup will show all week 3 matchups)<br/><br/>My Team<br/>- Players with a Grey background are on a bye week.<br/>- You can now drop and add players to your team from the &ldquo;My Team&rdquo; tab.<br/>- You can also drop a player while looking at their stats (just like in the matchup page).<br/><br/>Other People\'s Team<br/>- No new features, just want to let you know that none of the features in the above &ldquo;My Team&rdquo; page are in the &ldquo;Other Team&rdquo; page&#8230; you can\'t see their byes unless you look at their matchup.  Strategery indeed.<br/><br/>Profile<br/>- Removed &ldquo;Quick Roster&rdquo;<br/>- Planning on adding &ldquo;Trophies and Achievements&rdquo; section.  I have plans for xbox live style unlockables and trophies for top 3 finishers in seasons.  This will go where the quickroster was.<br/><br/>I hope you like the UI improvements.<br/><br/>On the radar next is the Player tab. ','You will notice some minor and major (i\'d like to call them) improvements to your navigating experience as you traverse the site.Mostly this is all about increasing the amount of data you see in fewer places.  That means that you shouldn\'t have to click across 3 different pages on the site to get related data.  Changes include:Matchup- When you click on your own player to view their stats you have the option to drop them.- There is now a (B) added to the player\'s name if they are on a bye week.- When you look at a matchup it will show all of the matchups for that week at the bottom of the page so you can keep tabs on all of the scores.  The week of the matchups shown are dependent on which matchup you\'re looking at.  (Week 3 matchup will show all week 3 matchups)My Team- Players with a Grey background are on a bye week.- You can now drop and add players to your team from the &ldquo;My Team&rdquo; tab.- You can also drop a player while looking at their stats (just like in the matchup page).Other People\'s Team- No new features, just want to let you know that none of the features in the above &ldquo;My Team&rdquo; page are in the &ldquo;Other Team&rdquo; page&#8230; you can\'t see their byes unless you look at their matchup.  Strategery indeed.Profile- Removed &ldquo;Quick Roster&rdquo;- Planning on adding &ldquo;Trophies and Achievements&rdquo; section.  I have plans for xbox live style unlockables and trophies for top 3 finishers in seasons.  This will go where the quickroster was.I hope you like the UI improvements.On the radar next is the Player tab. ',23,1,'2012-02-25 19:05:32',NULL,'127.0.0.1',0),(67,'also fixed that pesky bug on a player\'s \"card\" that wouldn\'t show their current week stats... oh how important changing a > to >= can be.','also fixed that pesky bug on a player\'s &ldquo;card&rdquo; that wouldn\'t show their current week stats&#8230; oh how important changing a &gt; to &gt;= can be.','also fixed that pesky bug on a player\'s &ldquo;card&rdquo; that wouldn\'t show their current week stats&#8230; oh how important changing a > to >= can be.',23,1,'2012-02-25 19:59:17',NULL,'127.0.0.1',0),(68,'feature was added to drop a player from their stat sheet.  Anywhere you can view this sheet and they are on your team you will have the option to drop the player.\r\n\r\nDrop logic is still enforced though... if they have played during the current week... they can\'t be dropped.','feature was added to drop a player from their stat sheet.  Anywhere you can view this sheet and they are on your team you will have the option to drop the player.<br/><br/>Drop logic is still enforced though&#8230; if they have played during the current week&#8230; they can\'t be dropped.','feature was added to drop a player from their stat sheet.  Anywhere you can view this sheet and they are on your team you will have the option to drop the player.Drop logic is still enforced though&#8230; if they have played during the current week&#8230; they can\'t be dropped.',17,1,'2012-02-25 20:26:17',NULL,'127.0.0.1',0),(69,'This was a huge amount of work to do in so little time.  I had already built the list table and just had to build the navigation around them.\r\n\r\nRight now you can search for individual players, you can get a top 10 list of each position, or you can just see all of the players in that position.\r\n\r\nThere were a lot of little details that went into making that page, i\'m trying to move away from using URL context to provide navigation within a feature - unfortunately this makes for massive and unhealthy to maintain - templates.\r\n\r\nI hope you guys like the new page(s)','This was a huge amount of work to do in so little time.  I had already built the list table and just had to build the navigation around them.<br/><br/>Right now you can search for individual players, you can get a top 10 list of each position, or you can just see all of the players in that position.<br/><br/>There were a lot of little details that went into making that page, i\'m trying to move away from using URL context to provide navigation within a feature - unfortunately this makes for massive and unhealthy to maintain - templates.<br/><br/>I hope you guys like the new page(s)','This was a huge amount of work to do in so little time.  I had already built the list table and just had to build the navigation around them.Right now you can search for individual players, you can get a top 10 list of each position, or you can just see all of the players in that position.There were a lot of little details that went into making that page, i\'m trying to move away from using URL context to provide navigation within a feature - unfortunately this makes for massive and unhealthy to maintain - templates.I hope you guys like the new page(s)',24,1,'2012-02-25 23:45:06',NULL,'127.0.0.1',0),(70,'closing this thread as research tools are now rolled into players tab.','closing this thread as research tools are now rolled into players tab.','closing this thread as research tools are now rolled into players tab.',16,1,'2012-02-25 23:53:41',NULL,'127.0.0.1',0),(71,'It looks like nobody on Arizona thinks they have a bye week ever.  Putting this on the list of things to look into.\r\n\r\nHad a problem a long time ago with Arizona screwing up because it was trying to use ARZ not ARI, or something like that.','It looks like nobody on Arizona thinks they have a bye week ever.  Putting this on the list of things to look into.<br/><br/>Had a problem a long time ago with Arizona screwing up because it was trying to use ARZ not ARI, or something like that.','It looks like nobody on Arizona thinks they have a bye week ever.  Putting this on the list of things to look into.Had a problem a long time ago with Arizona screwing up because it was trying to use ARZ not ARI, or something like that.',25,1,'2012-02-26 22:24:15',NULL,'127.0.0.1',0),(72,'Add button to the \"Top Available\" list in the players tab.\r\n\r\nWill require some drop/add logic if you\'re trying to add someone and you don\'t have that spot open.  Not needed now but in the future would be nice.\r\n\r\n<note to self/>','Add button to the &ldquo;Top Available&rdquo; list in the players tab.<br/><br/>Will require some drop/add logic if you\'re trying to add someone and you don\'t have that spot open.  Not needed now but in the future would be nice.<br/><br/>&lt;note to self/&gt;','Add button to the &ldquo;Top Available&rdquo; list in the players tab.Will require some drop/add logic if you\'re trying to add someone and you don\'t have that spot open.  Not needed now but in the future would be nice.<note to self/>',26,1,'2012-02-26 22:26:26',NULL,'127.0.0.1',0),(73,'How do I tell if someone is injured?','How do I tell if someone is injured?','How do I tell if someone is injured?',27,29,'2012-02-27 14:30:10',NULL,'127.0.0.1',0),(74,'The only way now is if you look in their player card and the stats for the week are red. Bam injured.  I will be expanding on the health attrib sooooooon.','The only way now is if you look in their player card and the stats for the week are red. Bam injured.  I will be expanding on the health attrib sooooooon.','The only way now is if you look in their player card and the stats for the week are red. Bam injured.  I will be expanding on the health attrib sooooooon.',27,1,'2012-02-27 19:03:12',NULL,'127.0.0.1',0),(75,'Okay because I didn\'t write the stat extractor it only knew how to do what it was told to do by it\'s previous master.  Because of that it didn\'t really know how to handle injured players the week after they were injured and also when they came back.\r\n\r\nPreviously:  If a player was injured in Week X, they would earn the points for that week they had earned up to that point and be marked as INJURED.  The next week if they had not healed they would be marked as OK but not get any points.  There was no way to know based on the parsed stat files when the player had came back from injured and started earning points.\r\n\r\nI rewrote a little of my stat parser/formatter/uploader to account for a player being injured the previous week and still being injured. Starting (mainly week 9) you will notice players will be marked as INJURED for the whole duration of their injury.  \r\n\r\nThis is pretty sweet because I can keep a live track of a player\'s injury status now, before it was based on their previous week, and if they were out for more than 1 week their previous injury status would have been OK... majorly bad.\r\n\r\nGood Fix :)','Okay because I didn\'t write the stat extractor it only knew how to do what it was told to do by it\'s previous master.  Because of that it didn\'t really know how to handle injured players the week after they were injured and also when they came back.<br/><br/>Previously:  If a player was injured in Week X, they would earn the points for that week they had earned up to that point and be marked as INJURED.  The next week if they had not healed they would be marked as OK but not get any points.  There was no way to know based on the parsed stat files when the player had came back from injured and started earning points.<br/><br/>I rewrote a little of my stat parser/formatter/uploader to account for a player being injured the previous week and still being injured. Starting (mainly week 9) you will notice players will be marked as INJURED for the whole duration of their injury.  <br/><br/>This is pretty sweet because I can keep a live track of a player\'s injury status now, before it was based on their previous week, and if they were out for more than 1 week their previous injury status would have been OK&#8230; majorly bad.<br/><br/>Good Fix <img src=\"/static/pybb/emoticons/smile.png\" alt=\"smile\" />','Okay because I didn\'t write the stat extractor it only knew how to do what it was told to do by it\'s previous master.  Because of that it didn\'t really know how to handle injured players the week after they were injured and also when they came back.Previously:  If a player was injured in Week X, they would earn the points for that week they had earned up to that point and be marked as INJURED.  The next week if they had not healed they would be marked as OK but not get any points.  There was no way to know based on the parsed stat files when the player had came back from injured and started earning points.I rewrote a little of my stat parser/formatter/uploader to account for a player being injured the previous week and still being injured. Starting (mainly week 9) you will notice players will be marked as INJURED for the whole duration of their injury.  This is pretty sweet because I can keep a live track of a player\'s injury status now, before it was based on their previous week, and if they were out for more than 1 week their previous injury status would have been OK&#8230; majorly bad.Good Fix ',28,1,'2012-02-27 22:41:52',NULL,'127.0.0.1',0),(76,'I\'m going to be rolling the database back to the end of week 7 sims and totally erasing any roster changes you made during the season.  Your win/loss up to week 7 will reflect how your original (shitty) roster did up to that point.\r\n\r\npremptive stop your little bitching, you knew this would happen.\r\n\r\nI\'m putting my new injury tracking code under stress.  You guys need to earn your damn coveted BETA TESTER trophy somehow right?  Will roll it back sometime tonight, depending on when I muster up the courage to tell my (beta tester wife)','I\'m going to be rolling the database back to the end of week 7 sims and totally erasing any roster changes you made during the season.  Your win/loss up to week 7 will reflect how your original (shitty) roster did up to that point.<br/><br/>premptive stop your little bitching, you knew this would happen.<br/><br/>I\'m putting my new injury tracking code under stress.  You guys need to earn your damn coveted BETA TESTER trophy somehow right?  Will roll it back sometime tonight, depending on when I muster up the courage to tell my (beta tester wife)','I\'m going to be rolling the database back to the end of week 7 sims and totally erasing any roster changes you made during the season.  Your win/loss up to week 7 will reflect how your original (shitty) roster did up to that point.premptive stop your little bitching, you knew this would happen.I\'m putting my new injury tracking code under stress.  You guys need to earn your damn coveted BETA TESTER trophy somehow right?  Will roll it back sometime tonight, depending on when I muster up the courage to tell my (beta tester wife)',29,1,'2012-02-27 22:46:31',NULL,'127.0.0.1',0),(77,'rollback went off without a single error!  I managed to salvage your week 8 roster, the problem was that i didn\'t save any of your roster changes before that.  So whatever you week 8 roster was, it was your roster from week 1 for point calculation.\r\n\r\nobviously this has created a different outcome so far - so I hope you enjoyed it.\r\n\r\nWhat will you benefit from it?  When i put my front end checks in for injury status you will have much much MUCH more accurate reporting on if a player is injured or not.\r\n\r\nTime for bed.  Enjoy!','rollback went off without a single error!  I managed to salvage your week 8 roster, the problem was that i didn\'t save any of your roster changes before that.  So whatever you week 8 roster was, it was your roster from week 1 for point calculation.<br/><br/>obviously this has created a different outcome so far - so I hope you enjoyed it.<br/><br/>What will you benefit from it?  When i put my front end checks in for injury status you will have much much MUCH more accurate reporting on if a player is injured or not.<br/><br/>Time for bed.  Enjoy!','rollback went off without a single error!  I managed to salvage your week 8 roster, the problem was that i didn\'t save any of your roster changes before that.  So whatever you week 8 roster was, it was your roster from week 1 for point calculation.obviously this has created a different outcome so far - so I hope you enjoyed it.What will you benefit from it?  When i put my front end checks in for injury status you will have much much MUCH more accurate reporting on if a player is injured or not.Time for bed.  Enjoy!',29,1,'2012-02-27 23:23:06',NULL,'127.0.0.1',0),(78,'implemented the first part of this fix tonight. There are front end aspects that show injury status, but they aren\'t really hashed out and finalized yet. Immediate future will hold more concrete design decision.','implemented the first part of this fix tonight. There are front end aspects that show injury status, but they aren\'t really hashed out and finalized yet. Immediate future will hold more concrete design decision.','implemented the first part of this fix tonight. There are front end aspects that show injury status, but they aren\'t really hashed out and finalized yet. Immediate future will hold more concrete design decision.',27,1,'2012-02-27 23:29:58',NULL,'127.0.0.1',0),(79,'are bugged now, i know - will fix this tomorrow.  It\'s my own stupid fault.','are bugged now, i know - will fix this tomorrow.  It\'s my own stupid fault.','are bugged now, i know - will fix this tomorrow.  It\'s my own stupid fault.',30,1,'2012-02-27 23:30:50',NULL,'127.0.0.1',0),(80,'pretty sure I fixed this over lunch - can\'t test it locally and can\'t ssh in to restart server.  We\'ll see!','pretty sure I fixed this over lunch - can\'t test it locally and can\'t ssh in to restart server.  We\'ll see!','pretty sure I fixed this over lunch - can\'t test it locally and can\'t ssh in to restart server.  We\'ll see!',30,1,'2012-02-28 12:20:14',NULL,'127.0.0.1',0),(81,'confirmed fixed, even fixed atlanta\'s mystery missing bye weeks.','confirmed fixed, even fixed atlanta\'s mystery missing bye weeks.','confirmed fixed, even fixed atlanta\'s mystery missing bye weeks.',30,1,'2012-02-28 12:28:49',NULL,'127.0.0.1',0),(89,'This is now my top priority with manual draft being at it\'s level of completion.','This is now my top priority with manual draft being at it\'s level of completion.','This is now my top priority with manual draft being at it\'s level of completion.',26,1,'2012-03-13 22:15:42',NULL,'127.0.0.1',0),(90,'this guy is currently undraftable in my manual draft entry feature because he exists both on the NYG AND freaking CAR.  Give me CAR steve smith any day... maybe I should just rename NYG Steve Smith to \"Steve Smith 2\".\r\n\r\nProblem also exists with \"Mike Williams\".\r\n\r\nThanks a lot people who aren\'t creative in naming their kids.','this guy is currently undraftable in my manual draft entry feature because he exists both on the NYG AND freaking CAR.  Give me CAR steve smith any day&#8230; maybe I should just rename NYG Steve Smith to &ldquo;Steve Smith 2&rdquo;.<br/><br/>Problem also exists with &ldquo;Mike Williams&rdquo;.<br/><br/>Thanks a lot people who aren\'t creative in naming their kids.','this guy is currently undraftable in my manual draft entry feature because he exists both on the NYG AND freaking CAR.  Give me CAR steve smith any day&#8230; maybe I should just rename NYG Steve Smith to &ldquo;Steve Smith 2&rdquo;.Problem also exists with &ldquo;Mike Williams&rdquo;.Thanks a lot people who aren\'t creative in naming their kids.',34,1,'2012-03-13 22:19:39',NULL,'127.0.0.1',0),(84,'On my Droid when clicking on the stats table it thinks Its a phone number and opens the dialer with the nearest 7 digits','On my Droid when clicking on the stats table it thinks Its a phone number and opens the dialer with the nearest 7 digits','On my Droid when clicking on the stats table it thinks Its a phone number and opens the dialer with the nearest 7 digits',32,30,'2012-03-01 19:49:47',NULL,'127.0.0.1',0),(85,'Clicking on players doesnt always bring up players card on phone either','Clicking on players doesnt always bring up players card on phone either','Clicking on players doesnt always bring up players card on phone either',32,30,'2012-03-01 19:56:33',NULL,'127.0.0.1',0),(86,'yikes!  That\'s a funky bug.  I\'ll have to see it on your phone.','yikes!  That\'s a funky bug.  I\'ll have to see it on your phone.','yikes!  That\'s a funky bug.  I\'ll have to see it on your phone.',32,1,'2012-03-01 20:23:43',NULL,'127.0.0.1',0),(87,'Got something resembling a manual draft entry process.  Of course it\'s not 100% but it\'s damn near 99.99%!  I expect there to be many bugs and many more hours working on it but damn.  I did it!\r\n\r\nRight now it does this:\r\n\r\nSees that you have 10 teams in your league and you do not have any draft data & offers to create a draft for you.\r\nCreates a draft containing a randomized order of all teams in your league.\r\nAllows commissioner to manually enter each of the Draft Rounds team by team (7 rounds of 10 players).\r\nFinal Step allows commish to verify all picks are on the right teams (so far if they made a mistake oh well).\r\nConverts all draft data into week 1 roster for each team.  Roster data is then used for stat calculation.\r\n\r\nAll the while:\r\nEvery time you advance forward in the draft it validates:\r\nThere are no duplicate players in the round... no drafting Tom Brady 5 times.\r\nThe player is available to be drafted... don\'t try to draft Tom Brady in different rounds.\r\nThe team does not exceed the max number of players per position... Stop trying to draft Tom Brady!\r\n\r\nUnfortunately some of the errors cause catastrophic failure meaning if it\'s the first time you are entering the picks and you miss enter a player, all entries are lost.\r\n\r\nAlso a workaround for deleting a player from a draft round is to just erase their name and click \"Next\".  Next will not advance the round because not everyone has drafted, and it will refresh the page with the empty draft spot.  Although an easier way around that is to just replace the players name with the new (Available) players name.  I guess if you need to switch a pick to a different team in the round that\'s how you do it.  Just empty out both boxes and switch them.\r\n\r\nCan\'t wait for Commish Beta to test it out!','Got something resembling a manual draft entry process.  Of course it\'s not 100% but it\'s damn near 99.99%!  I expect there to be many bugs and many more hours working on it but damn.  I did it!<br/><br/>Right now it does this:<br/><br/>Sees that you have 10 teams in your league and you do not have any draft data &amp; offers to create a draft for you.<br/>Creates a draft containing a randomized order of all teams in your league.<br/>Allows commissioner to manually enter each of the Draft Rounds team by team (7 rounds of 10 players).<br/>Final Step allows commish to verify all picks are on the right teams (so far if they made a mistake oh well).<br/>Converts all draft data into week 1 roster for each team.  Roster data is then used for stat calculation.<br/><br/>All the while:<br/>Every time you advance forward in the draft it validates:<br/>There are no duplicate players in the round&#8230; no drafting Tom Brady 5 times.<br/>The player is available to be drafted&#8230; don\'t try to draft Tom Brady in different rounds.<br/>The team does not exceed the max number of players per position&#8230; Stop trying to draft Tom Brady!<br/><br/>Unfortunately some of the errors cause catastrophic failure meaning if it\'s the first time you are entering the picks and you miss enter a player, all entries are lost.<br/><br/>Also a workaround for deleting a player from a draft round is to just erase their name and click &ldquo;Next&rdquo;.  Next will not advance the round because not everyone has drafted, and it will refresh the page with the empty draft spot.  Although an easier way around that is to just replace the players name with the new (Available) players name.  I guess if you need to switch a pick to a different team in the round that\'s how you do it.  Just empty out both boxes and switch them.<br/><br/>Can\'t wait for Commish Beta to test it out!','Got something resembling a manual draft entry process.  Of course it\'s not 100% but it\'s damn near 99.99%!  I expect there to be many bugs and many more hours working on it but damn.  I did it!Right now it does this:Sees that you have 10 teams in your league and you do not have any draft data & offers to create a draft for you.Creates a draft containing a randomized order of all teams in your league.Allows commissioner to manually enter each of the Draft Rounds team by team (7 rounds of 10 players).Final Step allows commish to verify all picks are on the right teams (so far if they made a mistake oh well).Converts all draft data into week 1 roster for each team.  Roster data is then used for stat calculation.All the while:Every time you advance forward in the draft it validates:There are no duplicate players in the round&#8230; no drafting Tom Brady 5 times.The player is available to be drafted&#8230; don\'t try to draft Tom Brady in different rounds.The team does not exceed the max number of players per position&#8230; Stop trying to draft Tom Brady!Unfortunately some of the errors cause catastrophic failure meaning if it\'s the first time you are entering the picks and you miss enter a player, all entries are lost.Also a workaround for deleting a player from a draft round is to just erase their name and click &ldquo;Next&rdquo;.  Next will not advance the round because not everyone has drafted, and it will refresh the page with the empty draft spot.  Although an easier way around that is to just replace the players name with the new (Available) players name.  I guess if you need to switch a pick to a different team in the round that\'s how you do it.  Just empty out both boxes and switch them.Can\'t wait for Commish Beta to test it out!',33,1,'2012-03-12 21:53:37',NULL,'127.0.0.1',0),(88,'to clarify the \"catastrophic\" failure above:\r\n\r\nIf are in round 3 of entry and you spell Chris Johnson as Chris Johnso then when you go to advance, you will have to re-enter all of your Round 3 picks.\r\n\r\nI of course don\'t like this and will have to find a good way to solve it.','to clarify the &ldquo;catastrophic&rdquo; failure above:<br/><br/>If are in round 3 of entry and you spell Chris Johnson as Chris Johnso then when you go to advance, you will have to re-enter all of your Round 3 picks.<br/><br/>I of course don\'t like this and will have to find a good way to solve it.','to clarify the &ldquo;catastrophic&rdquo; failure above:If are in round 3 of entry and you spell Chris Johnson as Chris Johnso then when you go to advance, you will have to re-enter all of your Round 3 picks.I of course don\'t like this and will have to find a good way to solve it.',33,1,'2012-03-12 21:55:41',NULL,'127.0.0.1',0),(91,'For some reason they are still messed up somewhere in the database.  Maybe when I feel like fixing a data issue i\'ll get to it.  ugh.','For some reason they are still messed up somewhere in the database.  Maybe when I feel like fixing a data issue i\'ll get to it.  ugh.','For some reason they are still messed up somewhere in the database.  Maybe when I feel like fixing a data issue i\'ll get to it.  ugh.',35,1,'2012-03-13 22:22:52',NULL,'127.0.0.1',0),(92,'somehow ATL had their bye get set to week 4 but it should be at week 8.  Oh well - my app has corrupted the data and i\'ll have to write a script to fix it.  Not tonight.','somehow ATL had their bye get set to week 4 but it should be at week 8.  Oh well - my app has corrupted the data and i\'ll have to write a script to fix it.  Not tonight.','somehow ATL had their bye get set to week 4 but it should be at week 8.  Oh well - my app has corrupted the data and i\'ll have to write a script to fix it.  Not tonight.',35,1,'2012-03-16 23:19:45',NULL,'127.0.0.1',0),(93,'my stat processor doesn\'t seem to like it when a player gets injured, goes on a bye, and then is still injured after the bye - seems to make them Ok after that.\r\n\r\nugh.','my stat processor doesn\'t seem to like it when a player gets injured, goes on a bye, and then is still injured after the bye - seems to make them Ok after that.<br/><br/>ugh.','my stat processor doesn\'t seem to like it when a player gets injured, goes on a bye, and then is still injured after the bye - seems to make them Ok after that.ugh.',28,1,'2012-03-19 20:43:47',NULL,'127.0.0.1',0),(94,'Where does the league stand?\r\nAre we supposed to be troubleshooting anything at present?','Where does the league stand?<br/>Are we supposed to be troubleshooting anything at present?','Where does the league stand?Are we supposed to be troubleshooting anything at present?',36,29,'2012-03-27 09:53:23',NULL,'127.0.0.1',0);
